import React, { useRef } from "react";
import emailjs from "@emailjs/browser";
import "./Home.css";

const Home = () => {
  const form = useRef();

  const sendEmail = (e) => {
    e.preventDefault();

    emailjs
      .sendForm(
        "service_qompota",
        "template_95iekz2",
        form.current,
        "tkG‑UJe02yYKmGQ‑m"
      )
      .then(
        (result) => {
          console.log(result.text);
          alert("✅ Subscription successful! Thank you.");
          form.current.reset();
        },
        (error) => {
          console.log(error.text);
          alert("❌ Something went wrong. Please try again.");
        }
      );
  };

  return (
    <main className="home">
      {/* Hero Section */}
      <section className="hero">
        <div className="hero-content">
          <h1>The Live Shopping Marketplace</h1>
          <p>Shop, sell, and connect around the things you love.</p>
          <button className="btn-primary">Shop Now</button>
        </div>
        <div className="hero-image">
          <img src="assets/Hero.png" alt="Live Shopping" />
        </div>
      </section>

      {/* Feature Section */}
      <section className="feature">
        <div className="feature-image">
          <img src="assets/Hero2.jpeg" alt="Join the Fun" />
        </div>
        <div className="feature-content">
          <h2>Join In the Fun</h2>
          <p>Take part in fast‑paced auctions, flash sales, live show giveaways, and so much more.</p>
          <button className="btn-primary">Shop Now</button>
        </div>
      </section>

      {/* Categories Section */}
      <section className="categories">
        <div className="categories-content">
          <h2>We've Got It All</h2>
          <p>Explore 250+ categories, including fashion, coins, sports & Pokémon cards, sneakers, and more.</p>
          <button className="btn-primary">Shop Now</button>
        </div>
        <div className="categories-image">
          <img src="assets/c425.jpeg" alt="Exciting Shopping" />
        </div>
      </section>

      {/* Deals Section */}
      <section className="deals">
        <div className="deals-content">
          <h2>Find Incredible Deals on Name Brands</h2>
          <p>From the brands you love to hard‑to‑find specialty products — there's a deal on whatever you're looking for.</p>
          <button className="btn-primary">Shop Now</button>
        </div>
        <div className="deals-image">
          <img src="assets/images.png.png" alt="Amazing Deals" />
        </div>
      </section>

      {/* Newsletter Subscribe Section */}
      <section className="subscribe">
        <h2>Subscribe to Our Newsletter</h2>
        <p>Stay updated with the latest deals, offers, and live shopping events!</p>
        <form ref={form} onSubmit={sendEmail} className="subscribe-form">
          <input type="email" name="user_email" placeholder="Enter your email" required />
          <button type="submit" className="btn-secondary">Subscribe</button>
        </form>
      </section>
    </main>
  );
};

export default Home;
